    "2016-09-24T15:28:53.572822",nt"name": "introduced-terrestrial-species-future",nt"isopen":
    false,nt"url": null,nt"notes": "These data represent predicted future potential
    distributions of terrestrial plants, animals, and pathogens non-native to the Middle-Atlantic
    region. These data are available for 8-digit HUCs. The data are a weighted proportion
    of appropriate habitat overlapped by the potential distribution of a given species.
    Predictive models were built using current geographic distributions; these models
    were then projected onto a spatially explicit climate-change scenario (Hadley CM2
    GSdX20 model), demonstrating potential distributions of non-indigenous species for
    the Mid-Atlantic region for the 2020's. More information about these resources,
    including the variables used in this study, may be found here: https://edg.epa.gov/data/Public/ORD/NERL/ReVA/ReVA_Data.zip.",nt"license_title":
